int weight[MAX_VERTICES][MAX_VERTICES];

int record[MAX_VERTICES][MAX_VERTICES];

int distance[MAX_VERTICES];

int found[MAX_VERTICES];

int choose(int distance[], int n, int found[]) {//더 짧은 시간이 걸리는 거 선택

    int i, min, minpos;

    min = INT_MAX;

    minpos = -1;

    for (i = 0; i < n; i++)

        if (distance[i] < min && !found[i]) {

            min = distance[i];

            minpos = i;

        }

    return minpos;

}

void init_1(int n) {//weight배열 초기화

    int i, j;

    for (i = 0; i < n; i++) {

        for (j = 0; j < n; j++)

            weight[i][j] = metro[i].array_cost[j];

    }

}

void init_2(int n) {//record배열 초기화

    int i, j;

    for (i = 0; i < n; i++) {

        for (j = 0; j < n; j++)

            record[i][j] = INT_MIN;

    }

}

void shortest_path(int start, int n) {//최단 경로를 찾는 함수

    int i, j, u, w;

    for (i = 0; i < n; i++) {

        if (weight[start][i] != INF) {

            record[i][0] = start;

            record[i][1] = i;

        }
        //INF를 걸러내고 의미있는 숫자만 record에 저장

        distance[i] = weight[start][i];
        // 일단..저장

        found[i] = FALSE;

    }

    found[start] = TRUE;

    distance[start] = 0;

    for (i = 0; i < n - 2; i++) {

        u = choose(distance, n, found);

        found[u] = TRUE;

        for (w = 0; w < n; w++) {

            if (!found[w])

                if (distance[u] + weight[u][w] < distance[w]) {

                    distance[w] = distance[u] + weight[u][w];

                    for (j = 0; j < n; j++) {

                        record[w][j] = INT_MIN;

                    }

                    for (j = 0; j < n; j++) {

                        if (record[u][j] != INT_MIN)

                            record[w][j] = record[u][j];

                        else break;

                    }

                    record[w][j] = w;

                }



        }

    }

}

